import React, { Component, PropTypes } from "react";
import { BootstrapTable, TableHeaderColumn } from "react-bootstrap-table";

import axios from "axios";
import {
  Button,
  Card,
  CardHeader,
  CardBody,
  CardTitle,
  FormGroup,
  Table,
  Input,
  Container,
  Jumbotron,
  Row,
  Col,
} from "reactstrap";
import Select from "react-select";
import MapChart from "./MapChart";

class Homepage extends Component {
  constructor(props) {
    super(props);
    window.helloComponent = this;
    this.state = {
      players: [],
      isLoading: false,
      successModal: false,
      week_id: 1,
      fixture: [],
    };
    this.HandleWeek = this.HandleWeek.bind(this);
  }

  HandleWeek = (e) => {
    {
      console.log(e.value);
      this.setState({
        week_id: e.value,
      });
      this.getFixture(e.value);
    }
  };

  imageFormatteraway(cell, row) {
    {
      console.log(row);
    }
    return (
      <img
        alt="..."
        className="rounded-circle"
        src={row.away_team_logo}
        width="100"
        height="100"
      />
    );
  }
  imageFormatterhome(cell, row) {
    {
      console.log(row);
    }
    return (
      <img
        alt="..."
        className="rounded-circle"
        src={row.home_team_logo}
        width="100"
        height="100"
      />
    );
  }
  getFixture(week_id) {
    var accessTokenObj = localStorage.getItem("Access_Token");
    console.log(accessTokenObj);

    const config = {
      headers: { Authorization: `Bearer ${accessTokenObj}` },
    };
    console.log(week_id);
    const id = week_id;

    axios
      // This is where the data is hosted
      .get(`http://127.0.0.1:5000/fixture/web/${id}`, config)
      // Once we get a response and store data, let's change the loading state
      .then((response) => {
        console.log(response.data);
        this.setState({
          fixture: response.data.Fixture,
        });
      });

    // If we catch any errors connecting, let's update accordingly
  }
  componentDidMount() {
    this.getFixture(this.state.week_id);
  }
  render() {
    const { games } = this.state.fixture;

    const options = {
      expandRowBgColor: "rgb(173,216,230)",
      page: 1, // page that shows as default
      sizePerPageList: [
        {
          text: "5",
          value: 5,
        },
        {
          text: "10",
          value: 10,
        },
        {
          text: "25",
          value: 25,
        },
        {
          text: "50",
          value: 50,
        },
      ], // you can change the dropdown list for size per page
      sizePerPage: 25, // which size per page you want to locate as default
      pageStartIndex: 1, // where to start counting the pages
      paginationSize: 3, // the pagination bar size.
      prePage: "<", // Previous page button text
      nextPage: ">", // Next page button text
      firstPage: "<<", // First page button text
      lastPage: ">>", // Last page button text
      paginationShowsTotal: this.renderShowsTotal, // Accept bool or function
      paginationPosition: "top", // default is bottom, top and both is all available
      // hideSizePerPage: true > You can hide the dropdown for sizePerPage
      // alwaysShowAllBtns: true // Always show next and previous button
      // withFirstAndLast: false > Hide the going to First and Last page button
    };
    const op = [
      { value: "1", label: "Week1" },
      { value: "2", label: "Week2" },
      { value: "3", label: "Week3" },
      { value: "4", label: "Week4" },
      { value: "5", label: "Week5" },
      { value: "6", label: "Week6" },
      { value: "7", label: "Week7" },
      { value: "8", label: "Week8" },
      { value: "9", label: "Week9" },
      { value: "10", label: "Week10" },
      { value: "11", label: "Week11" },
      { value: "12", label: "Week12" },
      { value: "13", label: "Week13" },
      { value: "14", label: "Week14" },
      { value: "15", label: "Week15" },
      { value: "16", label: "Week16" },
      { value: "17", label: "Week17" },
      { value: "18", label: "Week18" },
      { value: "19", label: "Week19" },
      { value: "20", label: "Week20" },
      { value: "21", label: "Week21" },
      { value: "22", label: "Week22" },
      { value: "23", label: "Week23" },
      { value: "24", label: "Week24" },
      { value: "25", label: "Week25" },
      { value: "26", label: "Week26" },
      { value: "27", label: "Week27" },
      { value: "28", label: "Week28" },
      { value: "29", label: "Week29" },
      { value: "30", label: "Week30" },
    ];
    const { week } = this.state.week_id;
    return (
      <>
        <div>
          <Jumbotron fluid>
            <MapChart />/
          </Jumbotron>
        </div>
      </>
    );
  }
}
export default Homepage;
